import React from "react";
import { BrowserRouter as Router, Route, Routes,Navigate} from 'react-router-dom';
import Home from "./Home";
import Apptrans from "./Trasport/Apptrans";
import AppRes from "./RestaurantsBars/AppRes";
// import Appbiss from "./Business/Appbiss";
import Navbar from "./Navbar";

function App() {
  return (
    <div className="App">
     <Router>
     <Navbar/>
      <Routes>
      <Route path="/" element={<Navigate to="/home"/>}/>
      <Route path="/home" element={<Home/>}/> 
      {/* <Route path="/busineses" element={<Appbiss/>}/>  */}
      <Route path="/restaurantBars" element={<AppRes/>}/> 
      <Route path="/transport" element={<Apptrans/>}/> 
      </Routes>
     </Router>

    </div>
  );
}

export default App;
